import React, { Component } from "react";

class Monthselection extends Component {
  state = {
    Months: [
      {
        Rendermonth: "September 2020",
      },
      {
        Rendermonth: "August 2020",
      },
      {
        Rendermonth: "July 2020",
      },
      {
        Rendermonth: "June 2020",
      },
      {
        Rendermonth: "May 2020",
      },
      {
        Rendermonth: "April 2020",
      },
    ],
  };
  render() {
    const Renderlist = () => {
      this.state.Months.map((list) => {
        return <months Rendermonth={list} />;
      });
    };
    return (
      <section className="month-wrapper">
        <h1>Select a Month</h1>
        <ul>
          <li>{this.state.Months[0].September}</li>
          <li>{this.state.Months[1].August}</li>
          <li>{this.state.Months[2].July}</li>
          <li>{this.state.Months[3].June}</li>
          <li>{this.state.Months[4].May}</li>
          <li>{this.state.Months[5].April}</li>
        </ul>
      </section>
    );
  }
}

export default Monthselection;
